body {
  background-image: url('44.jpg');
  background-repeat: no-repeat;
  background-attachment: fixed; 
  background-size: 100% 100%;
  font-family: "Raleway", sans-serif;
  margin: auto;
  margin-right: 5%;
  margin-left: 5%;
}
h1{
  text-align: left;
  background-color: rgb(20, 143, 137);
  color:white;
  padding: 20px 10px;
  text-decoration: none;
  font-size: 25px;
  font-family:'Courier New', sans-serif;
  
}
.topnav {
  overflow: hidden;
  background-color: rgb(20, 143, 137);
  float:right;
  color:whitesmoke;
  font-family:'Trebuchet MS', sans-serif;

  
}
a{

  text-decoration: none;
}
.topnav a {
  float: left;
  color: #f2f2f2;
  text-align: center;
  padding: 20px 14px;
  text-decoration: none;
  font-size: 20px;
}

.topnav a:hover {
  background-color: #ddd;
  color: black;
  
}

h2 {
  text-align:center;
  background-color:rgb(135, 202, 199);
  color:whitesmoke;
  font-family: "Raleway", sans-serif;
}
h3{
  text-align: justify;
  background-color:rgb(135, 202, 199);
  color:whitesmoke;
  font-family: "Raleway", sans-serif;
}
p{
  text-align: justify;
  font-family: "Raleway", sans-serif;
}

ul li {
  text-align: justify;
  font-family: "Raleway", sans-serif;
  
}

